  <h2 style="text-align: center;">تفاصيل الاسم</h2>
  <div id="resultContainer"></div>

  <div class="pagination">
    <button class="page-btn" onclick="prevPage()">← السابق</button>
    <span id="pageNumber">1</span>
    <button class="page-btn" onclick="nextPage()">التالي →</button>
  </div>

  <script>
    const allResults = JSON.parse(localStorage.getItem("personData")) || [];
    let currentPage = 0;

    function displayPage(index) {
      const data = allResults[index];
      const container = document.getElementById("resultContainer");
      if (!data) {
        container.innerHTML = "<div class='info'>لم يتم العثور على بيانات!</div>";
        return;
      }
      container.innerHTML = `
        <div class="info"><strong>الاسم الثلاثي:</strong> ${data["الاسم الثلاثي"]}</div>
        <div class="info"><strong>اسم الأم:</strong> ${data["اسم الام"]}</div>
        <div class="info"><strong>رقم الهاتف:</strong> ${data["رقم الهاتف"]}</div>
        <div class="info"><strong>الفئة:</strong> ${data["الفئة"]}</div>
        <div class="info"><strong>الوجبة:</strong> ${data["الوجبة"]}</div>
        <div class="info"><strong>المعرف:</strong> ${data["المعرف"]}</div>
      `;
      document.getElementById("pageNumber").innerText = (index + 1) + " / " + allResults.length;
    }

    function nextPage() {
      if (currentPage < allResults.length - 1) {
        currentPage++;
        displayPage(currentPage);
      }
    }

    function prevPage() {
      if (currentPage > 0) {
        currentPage--;
        displayPage(currentPage);
      }
    }

    displayPage(currentPage);
  </script>
